sourcesContent:
// server/src/utils/questionGenerator.js

import openai from "openai";
import dotenv from "dotenv";
dotenv.config();

export const fetchRandomQuestions = async (topics) => {
  try {
    const apiKey = process.env.OPENAI_API_KEY;

    if (!apiKey) {
      throw new Error("OPENAI_API_KEY environment variable is missing");
    }

    const client = new openai.OpenAI({ apiKey });

    const response = await client.completions.create({
      engine: "text-davinci",
      prompt: `Generate questions related to ${topics.join(", ")}.`,
      max_tokens: 150,
      n: 5,
    });

    return response.data.choices.map((choice) => choice.text.trim());
  } catch (error) {
    console.error("Error generating questions:", error);
    return [];
  }
};

